import React from "react";

const Favourites = (props) => {
  console.log(props);

  let favMovieList = props.favList.map((url, index) => {
    return (
      <div key={index} id={index} className="fav">
        <img src={url} alt="" />
        <button onClick={props.removeFav}>Remove</button>
      </div>
    );
  });

  return (
    <div className="favContainer">
      <h2>Favourites:</h2>
      {favMovieList}
    </div>
  );
};
export default Favourites;
